// Memory
function _emscripten_memcpy_big(dest, src, num) {
  if (!wasmMemory) throw new Error('WASM Memory not initialized for memcpy')
  const heap = new Uint8Array(wasmMemory.buffer)
  heap.set(heap.slice(src, src + num), dest)
  return dest
}

