function _environ_sizes_get(penviron_count, penviron_buf_size) {
  console.warn('environ_sizes_get called - UNIMPLEMENTED')
  if (!wasmMemory) throw new Error('WASM Memory not initialized for environ_sizes_get')
  const heap32 = new Int32Array(wasmMemory.buffer)
  heap32[penviron_count >> 2] = 0 // 0 variables
  heap32[penviron_buf_size >> 2] = 0 // 0 buffer size needed
  return 0 // Success
}

function base64ToArrayBuffer(b64) {
  const binary_string = base64.decode(b64)
  const len = binary_string.length
  const bytes = new Uint8Array(len)
  for (let i = 0; i < len; i++) {
    bytes[i] = binary_string.charCodeAt(i)
  }
  return bytes.buffer
}

async function initialize() {
  if (initialized) return

  try {
    const compressedWasmData = base64ToArrayBuffer(WORKER_DATA)
    const wasmBuffer = pako.ungzip(compressedWasmData).buffer // Get ArrayBuffer

    // TODO: Determine the correct importObject required by the WASM module
    const importObject = {
      env: {
        // Map keys from asmLibraryArg to implemented functions
        g: ___assert_fail,
        u: ___cxa_throw,
        d: ___syscall_fcntl64,
        q: ___syscall_getdents64,
        h: ___syscall_ioctl,
        e: ___syscall_openat,
        o: ___syscall_rmdir,
        n: ___syscall_stat64,
        p: ___syscall_unlinkat,
        i: __emscripten_get_now_is_monotonic,
        l: _abort,
        f: _emscripten_date_now,
        j: _emscripten_memcpy_big,
        m: _emscripten_resize_heap,
        r: _environ_get,
        s: _environ_sizes_get,
        b: _fd_close,
        t: _fd_read,
        k: _fd_seek,
        c: _fd_write,
        // 'a': wasmMemory, // react-native-webassembly likely handles memory implicitly
        // If instantiation fails due to missing memory, uncomment above and define wasmMemory
      }
    }

    // Need to get the memory instance *after* instantiation if not provided
    const { instance: wasmInstance, module } = await WebAssembly.instantiate(wasmBuffer, importObject)
    instance = wasmInstance
    if (!wasmMemory && instance.exports.memory) {
        wasmMemory = instance.exports.memory // Get memory provided by the environment
    }

    initialized = true
    console.log('Phonemizer WASM initialized successfully')
  } catch (error) {
    console.error('Failed to initialize Phonemizer WASM:', error)
    throw error // Re-throw error to indicate initialization failure
  }
}

